import { Fragment } from "react";
import { useParams } from "react-router-dom";


const QuoteDetails = () => {
    const params = useParams()

    return <Fragment>
        <h1>This is quote details</h1>
        <p>{params.quotesId}</p>
    </Fragment>
}

export default QuoteDetails;
